// src/components/ExpensesTable.js

import React, { useState } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, TextField } from '@mui/material';

const initialRow = {
  id: null,
  column1: '',
  column2: '',
  column3: '',
  column4: '',
  column5: '',
  column6: '',
  column7: '',
};

const ExpensesTable = () => {
  const [rows, setRows] = useState([]);

  const addRow = () => {
    const newRow = { ...initialRow, id: rows.length + 1 };
    setRows([...rows, newRow]);
  };

  const handleInputChange = (id, field, value) => {
    const updatedRows = rows.map((row) =>
      row.id === id ? { ...row, [field]: value } : row
    );
    setRows(updatedRows);
  };

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Столбец 1</TableCell>
            <TableCell>Столбец 2</TableCell>
            <TableCell>Столбец 3</TableCell>
            <TableCell>Столбец 4</TableCell>
            <TableCell>Столбец 5</TableCell>
            <TableCell>Столбец 6</TableCell>
            <TableCell>Столбец 7</TableCell>
            <TableCell>
              <Button variant="contained" color="primary" onClick={addRow}>
                Добавить
              </Button>
            </TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.id}>
              <TableCell>
                <TextField
                  value={row.column1}
                  onChange={(e) => handleInputChange(row.id, 'column1', e.target.value)}
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={row.column2}
                  onChange={(e) => handleInputChange(row.id, 'column2', e.target.value)}
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={row.column3}
                  onChange={(e) => handleInputChange(row.id, 'column3', e.target.value)}
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={row.column4}
                  onChange={(e) => handleInputChange(row.id, 'column4', e.target.value)}
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={row.column5}
                  onChange={(e) => handleInputChange(row.id, 'column5', e.target.value)}
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={row.column6}
                  onChange={(e) => handleInputChange(row.id, 'column6', e.target.value)}
                />
              </TableCell>
              <TableCell>
                <TextField
                  value={row.column7}
                  onChange={(e) => handleInputChange(row.id, 'column7', e.target.value)}
                />
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default ExpensesTable;
